import React from "react"
import './Country.css'

export default function Country(props){
    console.log(props.languages[0])
    return(
        <div>
            {props.active === "Continent" ? <h1>{props.continent}</h1> : <h1>{props.languages[0].name}</h1>}
            <div className="countrycontainer">
                <h2 className="emoji">
                    {props.emoji}
                </h2>
                <h2 className="name">
                    {props.name}
                </h2>
            </div> 
            <h6 className="data">
                Capital: {props.capital}<br/>
                Currency: {props.currency}
            </h6>       
        </div>
    )
}
